import React, { useState } from 'react';
import './styles.css';

const App = () => {
  const [currentPage, setCurrentPage] = useState('welcome'); // State to manage current page

  const handleLoginClick = () => {
    setCurrentPage('login');
  };

  const handleSignupClick = () => {
    setCurrentPage('signup');
  };

  const handleRoleSelection = (role) => {
    // Handle role selection logic here
    console.log('Selected Role:', role);
    setCurrentPage('personal-info');
  };

  const handleNextButtonClick = () => {
    setCurrentPage('invite-section');
  };

  const handleLoginFormSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log('Login form submitted');
    setCurrentPage('dashboard');
  };

  const handleSignupFormSubmit = (e) => {
    e.preventDefault();
    // Handle sign up logic here
    console.log('Sign up form submitted');
    setCurrentPage('role-selection');
  };

  const handleInviteButtonClick = (hasInvite) => {
    if (hasInvite) {
      setCurrentPage('invite-section');
    } else {
      setCurrentPage('dashboard');
    }
  };

  return (
    <div className="app">
      {/* Welcome Section */}
      {currentPage === 'welcome' && (
        <section id="section1">
          <header>Welcome</header>
          <p>Hello world for now!</p>
          <div id="login-signup-buttons">
            <button className="login-button" onClick={handleLoginClick}>Login</button>
            <button className="signup-button" onClick={handleSignupClick}>Sign Up</button>
          </div>
        </section>
      )}

      {/* Login and Sign Up Section */}
      {(currentPage === 'login' || currentPage === 'signup') && (
        <section id="sectionloginsignup" className="login-sign-up">
          {/* Login Form */}
          {currentPage === 'login' && (
            <div id="login-form" className="form-container">
              <h2>Login</h2>
              <form onSubmit={handleLoginFormSubmit}>
                <label htmlFor="login-username">Username:</label>
                <input type="text" id="login-username" name="login-username" required />

                <label htmlFor="login-password">Password:</label>
                <input type="password" id="login-password" name="login-password" required />

                <button type="submit">Login</button>
                <p>Don't have an account? <button onClick={handleSignupClick}>Sign Up</button></p>
              </form>
            </div>
          )}

          {/* SignUp Form */}
          {currentPage === 'signup' && (
            <div id="signup-form" className="form-container">
              <h2>Sign Up</h2>
              <form onSubmit={handleSignupFormSubmit}>
                {/* Add your signup form fields here */}
                <button type="submit">Sign Up</button>
                <p>Already have an account? <button onClick={handleLoginClick}>Login</button></p>
              </form>
            </div>
          )}
        </section>
      )}

      {/* Role Selection */}
      {currentPage === 'role-selection' && (
        <div id="role-selection" className="form-container">
          <h2>Are you...</h2>
          <p>Select your role:</p>
          <button className="role-button" onClick={() => handleRoleSelection('pregnant')}>
            Pregnant
          </button>
          <button className="role-button" onClick={() => handleRoleSelection('professional')}>
            Healthcare Professional
          </button>
          {/* Add other role buttons here */}
        </div>
      )}

      {/* Personal Information Form */}
      {currentPage === 'personal-info' && (
        <div id="personal-info" className="form-container">
          <h2>Personal Information</h2>
          <form onSubmit={handleNextButtonClick}>
            {/* Add your personal information form fields here */}
            <button type="submit">Next</button>
          </form>
        </div>
      )}

      {/* Invite Section */}
      {currentPage === 'invite-section' && (
        <section id="sectioninvite">
          <div id="invite">
            <h2>Have you received an invite code?</h2>
            <button type="button" onClick={() => handleInviteButtonClick(true)}>Yes</button>
            <button type="button" onClick={() => handleInviteButtonClick(false)}>No</button>
          </div>
        </section>
      )}

      {/* Dashboard Section */}
      {currentPage === 'dashboard' && (
        <section id="sectiondashboard">
          <div id="dashboard">
            <header>Dashboard</header>
            <p>Welcome to your dashboard!</p>
          </div>
        </section>
      )}
    </div>
  );
};

export default App;
